import React from "react";
import styled from "styled-components";

const BorderSpan = styled.span`
  width: 152px;
  height: 2px;
  border: 1px solid var(--color-yellow);
  position: absolute;
  top: 30px;
`;

const BorderEffect = () => {
  return <BorderSpan></BorderSpan>;
};

export default BorderEffect;
